import React from 'react';
import './index.css';
const ToDoList = () => {
  return(
     <>
      <div className="main_div">
         <div className="centre_div">
           <h1> 0 </h1>
           <div className="btn-div">
              <button>Increm</button>
              <button>Decrem</button>
           </div>
         </div>

      </div>

     </>
  );
}

export default ToDoList;
